import React from 'react';
import 'Home.css'

function Home() {
  return (
    <div className='home'>
      <h1>Home</h1>
      <a className='invitebutton' href='https://discord.com/oauth2/authorize?client_id=775542914117795860&permissions=8&scope=bot'></a>
    </div>
  );
}

export default Home;
